import React from 'react'
import { Link } from "react-router-dom";
import './Navbar.css'

function Navbar() {
  return (
    <>
      <Link to="Home">home</Link>
      <Link to="Projects">projects</Link>
      <Link to="About">about</Link>
      <Link to="Contact">contact me</Link>
    </>
  )
}

export default Navbar
